@copilot In multi-file mode, using `new Audio()` and `new Image()` in the JavaScript code to load data from a panel audio or image file doesnt seem to work. Please fix this. Heres a simple example app that doesnt work. Please fix it.

```html
<!DOCTYPE html>
<html>
<head>
  <title>Wallpaper + Audio Switcher</title>
  <style>
    body {
      margin: 0; height: 100vh;
      background: center/cover no-repeat;
      display: flex; justify-content: center; align-items: center;
    }
    button {
      padding: 10px 20px; font-size: 18px;
      border: none; border-radius: 8px; cursor: pointer;
    }
  </style>
</head>
<body>
  <button id="start">Start</button>
<script>
  const images = ["img/1.png","img/2.png"].map(src => (new Image().src = src, src));
  const audios = ["audio/1.mp3","audio/2.mp3"].map(src => new Audio(src));
  let i = 0;

  function switchMedia() {
    document.body.style.backgroundImage = `url('${images[i]}')`;
    audios.forEach(a => { a.pause(); a.currentTime = 0; });
    audios[i].play();
    i = (i + 1) % images.length;
  }

  document.getElementById("start").onclick = e => {
    e.target.remove();
    switchMedia();
    setInterval(switchMedia, 2000);
  };
</script>
</body>
</html>
```

